import React from "react";
import { Header, Container } from 'semantic-ui-react';
function Resume() {
  return (
      <Container>
        <Header as = 'h2' textAlign='center'> RESUME</Header>
      <Container text>
        <hr/>
        I also go by Shin and Shun.
        <hr/>

      </Container>
      </Container>

  );
}

export default Resume;
